CREATE DEFINER=`root`@`localhost` PROCEDURE `getBookings` (IN `inHotelId` INT(11), IN `inUserId` INT(11))   begin
	select 
		h.Name as HotelName,
		h.HotelId as HotelId,
		r.Name as RoomName,
		r.RoomId as RoomId,
		b.CheckIn as CheckIn,
		b.CheckOut as CheckOut,
		b.BookingTime as BookedOn,
		b.Amount as Amount,
		b.Paid as Paid,
		b.BookingId as BookingId,
		b.Status as Status
	from bookings b
		inner join hotels h on b.HotelId = h.HotelId
		inner join rooms r on b.RoomId = r.RoomId
	where b.HotelId = inHotelId or b.UserId = inUserId;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `getHotel` (IN `inUserId` INT(11))   begin 
	select * from hotels where UserId = inUserId;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `getHotelById` (IN `inHotelId` INT(11))   begin
	
select h.HotelId as HotelId, h.Rating as Rating, h.Name as Name, h.Description Description, h.Location as Location, h.TotalRooms as TotalRooms, h.Image as Image, u.Name as managerName, u.Email as managerEmail, u.UserId as managerId from hotels as h 
	inner join users u on u.UserId = h.UserId 
	where HotelId = inHotelId;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `getHotelFeedback` (IN `inUserId` INT(11), IN `inHotelId` INT(11))   begin
	if inUserId = 0 then
		select 
			f.feedback as feedback,
			u.Name
		from feedback f 
			inner join users u on u.userId = f.userId 
		where hotelId = inHotelId;
	else 
		select *from feedback where hotelId = inHotelId and userId = inUserId;
	end if;
	
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `getLoggedInUser` (IN `inEmail` VARCHAR(100), IN `inIsManager` TINYINT(1), IN `inPassword` VARCHAR(100))   begin
	
	select Name as name, UserId as id, Email as email, Password as password, IsManager as isManager from users where 
	Email = inEmail and 
	IsManager = inIsManager and 
