END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `getRooms` (IN `inUserId` INT(11), IN `inHotelId` INT(11))   begin
	select * from rooms where UserId = inUserId and HotelId = inHotelId and IsDeleted = false;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `getUserById` (IN `inId` INT(11))   begin
	select Name as name, UserId as id, Email as email, Password as password, IsManager as isManager from users where 
	UserId =inId;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `searchHotels` (IN `query` VARCHAR(100))   begin
	SELECT *
	FROM hotels
	WHERE 
		lower(Name) like concat("%", query, "%") or 
		lower(Location) like concat("%", query, "%");
	
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `updateBooking` (IN `inStatus` VARCHAR(100), IN `inBookingId` INT(11))   begin
	update bookings set Status = inStatus where BookingId = inBookingId;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `updateHotel` (IN `inName` VARCHAR(100), IN `inDesc` MEDIUMTEXT, IN `inImage` MEDIUMTEXT, IN `inLocation` VARCHAR(100), IN `inTotalRooms` INT(11), IN `inHotelId` INT(11), IN `inRating` INT(11))   begin
	update hotels set
	Name = ifnull(inName, Name),
	Description = ifnull(inDesc, Description),
	Image = ifnull(inImage, Image),
	Location = ifnull(inLocation, Location),
	TotalRooms = ifnull(inTotalRooms, TotalRooms),
	Rating = ifnull((inRating + Rating) / 2, Rating)
	where HotelId = inHotelId;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `updateRoom` (IN `inRoomId` INT(11), IN `inName` VARCHAR(100), IN `inDesc` MEDIUMTEXT, IN `inOccupancy` INT(11), IN `inSpecification` TEXT, IN `inPrice` DECIMAL, IN `inImage1` MEDIUMTEXT, IN `inImage2` MEDIUMTEXT, IN `inImage3` MEDIUMTEXT)   begin
