	set
		Name = ifnull(inName, Name),
		Description = ifnull(inDesc, Description),
		Occupancy = ifnull(inOccupancy, Occupancy),
		Specification = ifnull(inSpecification, Specification),
		Price = ifnull(inPrice, Price),
		Image1 = ifnull(inImage1, Image1),
		Image2 = ifnull(inImage2, Image2),
		Image3 = ifnull(inImage3, Image3)
	where RoomId = inRoomId;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `updateUser` (IN `inId` INT(11), IN `inName` VARCHAR(100), IN `inEmail` VARCHAR(100), IN `inPassword` VARCHAR(100))   begin
	update users set
	Name = ifnull(inName, Name),
	Email = ifnull(inEmail, Email),
